import React from "react";
import Product from "../../Products/Product";
import ProductList from "../../Products/ProductList";
import Footer from "../../Footer";
import Logo from "../../Logo/Logo";

export default function Shop(props) {
  const { items } = props;
  console.log(props);
  return (
    <>
      <div id="shop-logo">
        <Logo />
      </div>

      <div className="shop-page">
        <nav className="shop-tabs">
          <a href="/shop/jackets">jackets</a>
          <a href="/shop/accessories">hats/accessories</a>
          <a href="/shop/tops">tops/sweaters</a>
          <a href="/shop/shirts">shirts</a>
          <a href="/shop/pants">pants</a>
        </nav>
      </div>
      <div>
        {items.map((images) => {
          for (let i = 0; i < items.length; i++)
            <Product key={items[i].id} items={items} src={images[i]}></Product>;
        })}
      </div>

      <ProductList />

      <Footer className="sticky" />
    </>
  );
}
